import React from 'react';
import './App.css';
import Homepage from './pages/homepage/homepage.component';
import {Route} from 'react-router-dom';

const HatsPage=()=>(
  <div>
    <h1>HATS</h1>
  </div>
)

function App() {
  return (
    <div>
      <Route exact url='/' component={Homepage} />
      <Route exact url='/hats' component={HatsPage} />
    </div>
  );
}

export default App;
